class Profile:
    def __init__(self, name, h, b, s, t, r, weight, area, av_z, av_y, wel_y, wpl_y, wel_z, I_y, I_z, I_T, W_T, I_w, W_w, buck_Maj_axis, buck_Min_axis, fy = fy_0):
        self.name = name
        self.h = h
        self.b = b
        self.s = s
        self.t = t
        self.r = r
        self.weight = weight
        self.area = area
        self.av_z = av_z
        self.av_y = av_y
        self.wel_y = wel_y
        self.wpl_y = wpl_y
        self.wel_z = wel_z
        self.fy = fy
        self.I_y = I_y
        self.I_z = I_z
        self.I_T = I_T
        self.W_T = W_T
        self.I_W = I_w
        self.W_W = W_w
        self.buck_Maj_axis = buck_Maj_axis
        self.buck_Min_axis = buck_Min_axis
        self.i_y = np.sqrt(I_y*1e6/area)
        self.i_z = np.sqrt(I_z*1e6/area)

        if self.s == self.t:
            self.isIprofile = False
        else:
            self.isIprofile = True

    def getV_z(self):
        return self.av_z * self.fy / gamma1 / np.sqrt(3) / 1000
        # enhet: kN
    def getV_y(self):
        # enhet: kN
        return self.av_y * self.fy / gamma1 / np.sqrt(3) / 1000
    def getM_y(self):
        # enhet: kNm
        return self.wel_y * self.fy / gamma1 / 1000
    def getM_z(self):
        # enhet: kNm
        return self.wel_z * self.fy / gamma1 / 1000
    def getI_z(self):
        # enhet 10^6 mm3
        return self.I_z

    def __str__(self):
        if self.isIprofile:
            tekst = f"0 {self.name} {self.h} {self.b} {self.s} {self.t} {self.r} {self.area} {self.I_T*1e3}" \
                    f" {self.I_W*1e6} {self.i_y:.2f} {self.I_y*1e6} {self.i_z:.2f} {self.I_z*1e6}" \
                    f" {self.wpl_y/2*1e3} {self.wel_y*1e3} {self.wel_z*1e3} "
        else:
            tekst = f"1 {self.name} {self.h} {self.b} {self.t} {self.area} {self.I_T * 1e3}" \
                    f" {self.i_y:.2f} {self.I_y * 1e6} {self.i_z:.2f} {self.I_z * 1e6} {self.wpl_y * 1e3}" \
                    f" {self.wpl_y * 1e3} {self.wel_y * 1e3} {self.wel_z * 1e3}"

        return tekst

    def printmeg(self):
        if self.isIprofile:
            tekst = f"0 {self.name} {self.h} {self.b} {self.s} {self.t} {self.r} {self.area} {self.I_T*1e3}" \
                    f" {self.I_W*1e6} {self.i_y:.2f} {self.I_y*1e6} {self.i_z:.2f} {self.I_z*1e6}" \
                    f" {self.wpl_y/2*1e3} {self.wel_y*1e3} {self.wel_z*1e3}"
        else:
            tekst = f"1 {self.name} {self.h} {self.b} {self.t} {self.area} {self.I_T * 1e3}" \
                    f" {self.i_y:.2f} {self.I_y * 1e6} {self.i_z:.2f} {self.I_z * 1e6} {self.wpl_y * 1e3}" \
                    f" {self.wpl_y * 1e3} {self.wel_y * 1e3} {self.wel_z * 1e3}"
        return tekst

class rektProfile(Profile):
    def __init__(self, name, h, b, s, t, r, weight, area, av_z, av_y, wel_y, wpl_y, wel_z, wpl_z, I_y, I_z, I_T, W_T, I_w, W_w, buck_Maj_axis, buck_Min_axis, fy = fy_0):
        Profile.__init__(self, name, h, b, s, t, r, weight, area, av_z, av_y, wel_y, wpl_y, wel_z, I_y, I_z, I_T, W_T, I_w, W_w, buck_Maj_axis, buck_Min_axis, fy)
        self.wpl_z = wpl_z

    def __str__(self):
        tekst = f"2 {self.name} {self.h} {self.b} {self.t} {self.area} {self.I_T * 1e3}" \
                f" {self.i_y:.2f} {self.I_y * 1e6} {self.i_z:.2f} {self.I_z * 1e6} {self.wpl_y * 1e3}" \
                f" {self.wpl_z* 1e3} {self.wel_y * 1e3} {self.wel_z * 1e3}"
        return tekst

    def printmeg(self):
        tekst = f"2 {self.name} {self.h} {self.b} {self.t} {self.area} {self.I_T * 1e3}" \
                f" {self.i_y:.2f} {self.I_y * 1e6} {self.i_z:.2f} {self.I_z * 1e6} {self.wpl_y * 1e3}" \
                f" {self.wpl_z* 1e3} {self.wel_y * 1e3} {self.wel_z * 1e3}"
        return tekst

def evaluateProfile(profile: Profile, l, q_perm, q_var):
    global failure, E_steel, def_limit
    if (q_perm * 1.2 + q_var * 1.5) > (q_perm * 1.35 + q_var * 1.05):
        q_str = q_perm * 1.2 + q_var * 1.5
    else:
        q_str = q_perm * 1.35 + q_var * 1.05

    V_Ed_z = q_str * l / 2
    M_Ed_y = q_str * l**2 / 8

    M_Rd_y = profile.getM_y()
    V_Rd_z = profile.getV_z()
    I_z = profile.getI_z()

    if V_Ed_z > V_Rd_z:
        return failure
    elif M_Ed_y > M_Rd_y:
        return failure
    elif 5 * (q_perm + q_var) *l**4 / (384 * E_steel * I_z) * 1e6 > 1000 * l / def_limit:
        return failure
    else:
        return profile.weight

