def findBestProfile(span, q_perm, q_var, list):
    iter=0
    bestWeight = 1001
    if (q_perm * 1.2 + q_var * 1.5) > (q_perm * 1.35 + q_var * 1.05):
        q_load = q_perm * 1.2 + q_var * 1.5
    else:
        q_load = q_perm * 1.35 + q_var * 1.05

    V_z = span*q_load / 2
    M_y = span**2 * q_load / 8
    for profileList in list:
        for listIter in range(len(profileList)):
            iter += 1
            weightCurrentProfile = evaluateProfile(profileList[listIter], span, q_perm, q_var)
            if weightCurrentProfile < bestWeight:
                numberEncoded = iter - 1
                bestWeight = weightCurrentProfile
                bestProfile = profileList[listIter]
    return bestProfile, numberEncoded

def makeEncoding(list):
    iter = 0
    with open("Encoding.txt", "w") as f1:
        for profileList in list:
            for listIter in range(len(profileList)):
                if iter == 0:
                    f1.write(str(iter) + "\t\t" + profileList[listIter].name)
                else:
                    f1.write("\n" + str(iter) + "\t\t" + profileList[listIter].name)
                iter += 1

def makeTestSet(span, q_perm, q_var, list):
    global l_testData, X_test, y_test
    l_testData += 1
    bestProfile, number = findBestProfile(span, q_perm, q_var, list)
    number = np.uint8(number)
    if y_test[0] == 0:
        X_test[0] = [span, q_perm, q_var]
        y_test[0] = number
    else:
        X_test = np.append(X_test, [[span, q_perm, q_var]], axis=0)
        y_test = np.append(y_test, [number], axis=0)

